import React from 'react';
import './App.css';
import Main from './Main';
import SearchResult from './SearchResult';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>PhishGuardian</h1>
      </header>
      <main>
        <Main />
        <SearchResult />
      </main>
    </div>
  );
}

export default App;
